import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import Navbar from '../components/Navbar';
import TicketCard from '../components/TicketCard';
import StatCard from '../components/StatCard';
import QuickActionCard from '../components/QuickActionCard';
import ticketService from '../services/ticketService';
import userService from '../services/userService';
import '../styles/Dashboard.css';

const StaffDashboard = () => {
  const [dashboardData, setDashboardData] = useState({});
  const [recentTickets, setRecentTickets] = useState([]);
  const [departmentStats, setDepartmentStats] = useState({});
  const [loading, setLoading] = useState(true);
  const [activeTab, setActiveTab] = useState('my-tickets');

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      const [ticketsResponse, statsResponse, departmentResponse] = await Promise.all([
        ticketService.getTickets({ limit: 6, sortBy: 'updatedAt', sortOrder: 'desc' }),
        userService.getUserStats(),
        userService.getDepartmentStats()
      ]);

      setRecentTickets(ticketsResponse.tickets);
      setDashboardData(statsResponse);
      setDepartmentStats(departmentResponse);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
    } finally {
      setLoading(false);
    }
  };

  const quickActions = [
    {
      label: 'Create Ticket',
      description: 'Report a new issue',
      icon: 'üìù',
      path: '/create-ticket',
      color: 'primary',
      emergency: false
    },
    {
      label: 'Classroom Emergency',
      description: 'Urgent teaching issue',
      icon: 'üö®',
      path: '/create-ticket?emergency=true',
      color: 'danger',
      emergency: true
    },
    {
      label: 'Knowledge Base',
      description: 'Find solutions',
      icon: 'üìö',
      path: '/knowledge-base',
      color: 'info',
      emergency: false
    },
    {
      label: 'Equipment Request',
      description: 'Request hardware',
      icon: 'üíª',
      path: '/equipment-request',
      color: 'success',
      emergency: false
    }
  ];

  const teachingResources = [
    { name: 'Classroom Tech Guide', type: 'PDF', size: '2.4 MB' },
    { name: 'Zoom Setup Instructions', type: 'Video', size: '15 MB' },
    { name: 'Projector Troubleshooting', type: 'Article', size: '1.2 MB' }
  ];

  if (loading) {
    return (
      <>
        <Navbar />
        <div className="loading-container">
          <div className="loading-spinner"></div>
          <p>Loading your dashboard...</p>
        </div>
      </>
    );
  }

  return (
    <>
      <Navbar />
      <div className="dashboard staff-dashboard">
        {/* Welcome Header */}
        <div className="dashboard-header">
          <div className="welcome-section">
            <h1>Welcome back! üëã</h1>
            <p className="welcome-message">
              Here's your support overview and quick access to IT services.
            </p>
          </div>
          <div className="header-actions">
            <Link to="/create-ticket" className="btn-primary large">
              üìù Create New Ticket
            </Link>
          </div>
        </div>

        {/* Emergency Alert Banner */}
        <div className="emergency-banner">
          <div className="emergency-content">
            <span className="emergency-icon">üö®</span>
            <div className="emergency-text">
              <strong>Teaching Emergency?</strong>
              <span>Get immediate classroom support</span>
            </div>
            <Link to="/create-ticket?emergency=true" className="btn-emergency">
              Emergency Help
            </Link>
          </div>
        </div>

        {/* Quick Actions Section */}
        <div className="quick-actions-section">
          <h2>Quick Actions</h2>
          <div className="quick-actions-grid">
            {quickActions.map((action, index) => (
              <QuickActionCard
                key={index}
                {...action}
              />
            ))}
          </div>
        </div>

        {/* Personal Stats */}
        <div className="metrics-section">
          <h2>My Support Overview</h2>
          <div className="metrics-grid">
            <StatCard
              title="My Open Tickets"
              value={dashboardData.openTickets || 0}
              icon="üìã"
              color="warning"
              description="Tickets needing attention"
            />
            <StatCard
              title="In Progress"
              value={dashboardData.inProgressTickets || 0}
              icon="üîÑ"
              color="info"
              description="Being worked on"
            />
            <StatCard
              title="Recently Resolved"
              value={dashboardData.resolvedTickets || 0}
              icon="‚úÖ"
              color="success"
              description="Past 7 days"
            />
            <StatCard
              title="Avg. Response Time"
              value={`${dashboardData.avgResponseTime || 0}h`}
              icon="‚è±Ô∏è"
              color="primary"
              description="Time to first response"
            />
          </div>
        </div>

        {/* Department Overview */}
        {departmentStats && (
          <div className="department-section">
            <div className="section-header">
              <h2>Department Overview</h2>
              <span className="section-subtitle">
                {departmentStats.departmentName} ‚Ä¢ {departmentStats.totalMembers} members
              </span>
            </div>
            <div className="department-stats">
              <div className="department-stat">
                <span className="stat-label">Active Tickets</span>
                <span className="stat-value">{departmentStats.activeTickets || 0}</span>
              </div>
              <div className="department-stat">
                <span className="stat-label">Most Common Issue</span>
                <span className="stat-value">{departmentStats.commonIssue || 'Software'}</span>
              </div>
              <div className="department-stat">
                <span className="stat-label">Satisfaction</span>
                <span className="stat-value">{departmentStats.satisfactionRate || 95}%</span>
              </div>
            </div>
          </div>
        )}

        {/* Recent Tickets with Tabs */}
        <div className="recent-activity-section">
          <div className="section-header">
            <h2>My Tickets</h2>
            <div className="tab-navigation">
              <button 
                className={`tab-button ${activeTab === 'my-tickets' ? 'active' : ''}`}
                onClick={() => setActiveTab('my-tickets')}
              >
                All Tickets
              </button>
              <button 
                className={`tab-button ${activeTab === 'open' ? 'active' : ''}`}
                onClick={() => setActiveTab('open')}
              >
                Open
              </button>
              <button 
                className={`tab-button ${activeTab === 'in-progress' ? 'active' : ''}`}
                onClick={() => setActiveTab('in-progress')}
              >
                In Progress
              </button>
            </div>
          </div>

          {recentTickets.length === 0 ? (
            <div className="empty-state">
              <div className="empty-icon">üìã</div>
              <h3>No Tickets Yet</h3>
              <p>You haven't created any support tickets yet.</p>
              <Link to="/create-ticket" className="btn-primary">
                Create Your First Ticket
              </Link>
            </div>
          ) : (
            <>
              <div className="tickets-grid">
                {recentTickets
                  .filter(ticket => {
                    if (activeTab === 'my-tickets') return true;
                    return ticket.status === activeTab;
                  })
                  .map(ticket => (
                    <TicketCard key={ticket._id} ticket={ticket} />
                  ))
                }
              </div>
              <div className="view-all">
                <Link to="/tickets" className="btn-secondary">
                  View All My Tickets
                </Link>
              </div>
            </>
          )}
        </div>

        {/* Teaching Resources */}
        <div className="resources-section">
          <div className="section-header">
            <h2>Teaching Resources</h2>
            <Link to="/resources" className="btn-text">
              View All Resources ‚Üí
            </Link>
          </div>
          <div className="resources-grid">
            {teachingResources.map((resource, index) => (
              <div key={index} className="resource-card">
                <div className="resource-icon">
                  {resource.type === 'PDF' ? 'üìÑ' : 
                   resource.type === 'Video' ? 'üé¨' : 'üìù'}
                </div>
                <div className="resource-info">
                  <h4>{resource.name}</h4>
                  <div className="resource-meta">
                    <span>{resource.type}</span>
                    <span>‚Ä¢</span>
                    <span>{resource.size}</span>
                  </div>
                </div>
                <button className="btn-download">Download</button>
              </div>
            ))}
          </div>
        </div>

        {/* Quick Support Contact */}
        <div className="support-contact">
          <div className="contact-card">
            <div className="contact-info">
              <h3>Need Immediate Help?</h3>
              <p>Contact the IT Help Desk for urgent issues</p>
              <div className="contact-methods">
                <div className="contact-method">
                  <span className="method-icon">üìû</span>
                  <span>Extension: 4357</span>
                </div>
                <div className="contact-method">
                  <span className="method-icon">üí¨</span>
                  <span>Live Chat</span>
                </div>
                <div className="contact-method">
                  <span className="method-icon">üè¢</span>
                  <span>Library Building, Room 205</span>
                </div>
              </div>
            </div>
            <div className="contact-actions">
              <button className="btn-primary">Call Now</button>
              <button className="btn-secondary">Start Chat</button>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default StaffDashboard;
